"use client"
import {
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  IconButton,
  Checkbox,
  Chip,
  Typography,
  Box,
  Paper,
} from "@mui/material"
import { Edit, Delete, CheckCircle, Schedule } from "@mui/icons-material"

export default function TaskList({ tasks, onToggleComplete, onEdit, onDelete }) {
  if (tasks.length === 0) {
    return (
      <Paper sx={{ p: 3, textAlign: "center" }}>
        <Typography variant="h6" color="text.secondary">
          No tasks found
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Create your first task to get started!
        </Typography>
      </Paper>
    )
  }

  return (
    <List>
   {tasks.map((task) => {
  let dueDateObj = null;
  if (task.due_date) {
    const dateStr = task.due_date.includes('T')
      ? task.due_date
      : `${task.due_date}T00:00:00`;

    const parsed = new Date(dateStr);
    dueDateObj = isNaN(parsed) ? null : parsed;
  }

  const formattedDueDate = dueDateObj
    ? dueDateObj.toLocaleDateString()
    : "No date";

  const isOverdue =
    dueDateObj && dueDateObj < new Date() && !task.completed;

        return (
          <Paper key={task.id} sx={{ mb: 1 }}>
            <ListItem>
              <Checkbox
                checked={task.completed}
                onChange={() => onToggleComplete(task)}
                sx={{ mr: 1 }}
                color="success"
              />
              <ListItemText
                primary={
                  <Box sx={{ display: "flex", alignItems: "center", gap: 1 }}>
                    <Typography
                      variant="h6"
                      sx={{
                        textDecoration: task.completed ? "line-through" : "none",
                        color: task.completed ? "text.secondary" : "text.primary",
                      }}
                    >
                      {task.title}
                    </Typography>
                    <Chip
                      icon={task.completed ? <CheckCircle /> : <Schedule />}
                      label={task.completed ? "Completed" : "Pending"}
                      size="small"
                      color={task.completed ? "success" : "warning"}
                      variant={task.completed ? "filled" : "outlined"}
                      sx={{
                        fontWeight: "bold",
                        "& .MuiChip-icon": {
                          fontSize: "16px",
                        },
                      }}
                    />
                  </Box>
                }
                secondary={
                  <Box sx={{ mt: 1 }}>
                    {task.description && (
                      <Typography
                        variant="body2"
                        sx={{
                          mb: 1,
                          color: task.completed ? "text.secondary" : "text.primary",
                          fontStyle: task.completed ? "italic" : "normal",
                        }}
                      >
                        {task.description}
                      </Typography>
                    )}
                    <Box sx={{ display: "flex", gap: 1, alignItems: "center", flexWrap: "wrap" }}>
                      <Chip label={task.category_name} size="small" color="primary" variant="outlined" />
                      {formattedDueDate && (
                        <Chip
                          label={`Due: ${formattedDueDate}`}
                          size="small"
                          color={
                            isOverdue
                              ? "error"
                              : task.completed
                              ? "success"
                              : "default"
                          }
                          variant="outlined"
                        />
                      )}
                      {isOverdue && (
                        <Chip
                          label="OVERDUE"
                          size="small"
                          color="error"
                          variant="filled"
                          sx={{
                            fontWeight: "bold",
                            animation: "pulse 2s infinite",
                          }}
                        />
                      )}

                    </Box>
                  </Box>
                }
              />
              <ListItemSecondaryAction>
                <IconButton onClick={() => onEdit(task)} size="small" color="primary" title="Edit Task">
                  <Edit />
                </IconButton>
                <IconButton onClick={() => onDelete(task)} size="small" color="error" title="Delete Task">
                  <Delete />
                </IconButton>
              </ListItemSecondaryAction>
            </ListItem>
          </Paper>
        );
      })}
    </List>
  );
}
